import React from "react";

import AddFriendForm from "../components/AddFriendForm";
import FriendsList from "../components/FriendsList";

const FriendsView = props => {
  return (
    <React.Fragment>
      <AddFriendForm />
      <FriendsList />
    </React.Fragment>
  );
};

export default FriendsView;
